import React from "react";

function Header() {
  return (
    <header className="fixed top-4 left-1/2 transform -translate-x-1/2 w-[90%] backdrop-blur-lg bg-white/10 shadow-lg border border-white/20 p-4 flex items-center justify-between px-8 rounded-2xl">
      <h1 className="text-white text-2xl font-bold">Drxck's Portfolio</h1>
      <nav>
        <ul className="flex space-x-6">
          <li>
            <button className="text-white text-lg hover:text-gray-300 transition">Home</button>
          </li>
          <li>
            <button className="text-white text-lg hover:text-gray-300 transition">Projects</button>
          </li>
          <li>
            <button className="text-white text-lg hover:text-gray-300 transition">Contact</button>
          </li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
